import React, {useEffect} from "react";
import Axios from "axios";
import { connect } from "react-redux";

const SavedRecipesPage = ({username}) => {

    const [recipeList, setRecipeList] = [];

    const getRecipes = () => {
        Axios.post("http://localhost:3001/getrecipes", {
        username: username,
        }).then((response) => {
            setRecipeList(response.data);
        });
    };

    useEffect(() => {
        getRecipes();
    }, []);



    return (
        <div>
            <div>Saved Recipes</div>
            {recipeList.map((element, i) => (
                <div key={i}>
                {element.title}
                {element.link}    
                </div>
            ))}
        </div>
    )
}

const mapStateToProps = (state) => ({
    username: state.username
  });

export default connect(mapStateToProps)(SavedRecipesPage);
